import React from 'react';
import { Star } from 'lucide-react';
import './ReviewsSections.css'; // Import the CSS file

const ReviewsSection = () => {
  const reviews = [
    {
      id: 1,
      name: "Meher",
      field: "Web Development",
      rating: 5,
      review: "Outstanding work on our e-commerce platform. The code quality is exceptional and the project was delivered ahead of schedule. Highly professional and responsive throughout the entire process.",
      avatar: "M",
      date: "2 weeks ago"
    },
    {
      id: 2,
      name: "Syamanth",
      field: "Mobile App Development",
      rating: 5,
      review: "Incredible attention to detail in our React Native app. The UI/UX implementation was pixel-perfect and the performance optimizations exceeded our expectations. Will definitely work again!",
      avatar: "S",
      date: "1 month ago"
    },
    {
      id: 3,
      name: "Chandu",
      field: "UI/UX Design",
      rating: 4,
      review: "Great design skills and creative approach to our brand identity project. The mockups were clean and modern. Communication could be improved, but the final deliverables were top-notch.",
      avatar: "C",
      date: "3 weeks ago"
    },
    {
      id: 4,
      name: "Hari",
      field: "Backend Development",
      rating: 5,
      review: "Solid backend architecture and API development. The database optimization and security implementations were exactly what we needed. Very knowledgeable and reliable developer.",
      avatar: "H",
      date: "1 week ago"
    },
    {
      id: 5,
      name: "Kalyan",
      field: "Full Stack Development",
      rating: 5,
      review: "Complete full-stack solution delivered perfectly. From frontend to backend, everything was seamlessly integrated. Great problem-solving skills and excellent code documentation.",
      avatar: "K",
      date: "4 days ago"
    }
  ];

  const renderStars = (rating) => {
    return Array.from({ length: 5 }, (_, index) => (
      <Star
        key={index}
        className={`w-4 h-4 ${
          index < rating
            ? 'text-yellow-400 fill-yellow-400'
            : 'text-gray-300'
        }`}
      />
    ));
  };

  const getAverageRating = () => {
    const total = reviews.reduce((sum, review) => sum + review.rating, 0);
    return (total / reviews.length).toFixed(1);
  };

  return (
    <div className="reviews-container">
      {/* Header Section */}
      <div className="reviews-header">
        <div className="text-center mb-12">
          <h2 className="text-4xl font-bold text-gray-800 mb-4">
            Client Reviews
          </h2>
          <p className="text-lg text-gray-600 max-w-2xl mx-auto mb-6">
            Don't just take my word for it. Here's what my clients have to say about working with me.
          </p>
          <div className="flex items-center justify-center gap-3">
            <div className="flex">
              {renderStars(5)}
            </div>
            <span className="text-2xl font-bold text-gray-800">
              {getAverageRating()}
            </span>
            <span className="text-gray-600">
              ({reviews.length} reviews)
            </span>
          </div>
        </div>
      </div>

      {/* Reviews Grid */}
      <div className="reviews-grid">
        {reviews.map((review) => (
          <div key={review.id} className="review-card">
            {/* Card Header */}
            <div className="review-header">
              <div className="reviewer-info">
                <div className="avatar">
                  {review.avatar}
                </div>
                <div>
                  <h4 className="reviewer-name">{review.name}</h4>
                  <p className="reviewer-field">{review.field}</p>
                </div>
              </div>
              <div className="review-meta">
                <div className="rating">
                  {renderStars(review.rating)}
                </div>
                <span className="review-date">{review.date}</span>
              </div>
            </div>

            {/* Review Content */}
            <div className="review-content">
              <p className="review-text">"{review.review}"</p>
            </div>
          </div>
        ))}
      </div>

      {/* Call to Action */}
      <div className="cta-section">
        <div className="text-center">
          <h3 className="text-2xl font-bold text-gray-800 mb-4">
            Ready to work together?
          </h3>
          <p className="text-gray-600 mb-6">
            Join these satisfied clients and let's bring your project to life.
          </p>
          <button className="cta-button">
            Get Started Today
          </button>
        </div>
      </div>
    </div>
  );
};

export default ReviewsSection;
